SELECT doc #> '{filter_level}' as group, COUNT(doc #> '{place,name}') FROM Twitter  WHERE jsonb_path_exists(doc,'$.user.lang.type() ? (@ == "string")')  GROUP BY doc #> '{filter_level}';
SELECT doc #> '{retweeted_status,user,location}' as group, SUM((doc #>> '{favorite_count}')::float) FROM Twitter  WHERE ( ( jsonb_path_exists(doc,'$.user.lang.type() ? (@ == "string")') AND ( ( ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.user.friends_count ? (@ <= 2151584.114948)') AND jsonb_path_exists(doc,'$.quoted_status.user.profile_sidebar_fill_color') ) OR jsonb_path_exists(doc,'$.quoted_status.user.url ? (@ starts with "ht")') ) OR jsonb_path_exists(doc,'$.retweeted_status.user.id_str') ) ) AND jsonb_path_exists(doc,'$.favorite_count.type() ? (@ == "number")') )  GROUP BY doc #> '{retweeted_status,user,location}';
SELECT doc #> '{retweeted_status,in_reply_to_status_id}' as group, COUNT(doc #> '{possibly_sensitive}') FROM Twitter  WHERE ( ( jsonb_path_exists(doc,'$.user.lang.type() ? (@ == "string")') AND ( ( ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.user.friends_count ? (@ <= 2151584.114948)') AND jsonb_path_exists(doc,'$.quoted_status.user.profile_sidebar_fill_color') ) OR jsonb_path_exists(doc,'$.quoted_status.user.url ? (@ starts with "ht")') ) OR jsonb_path_exists(doc,'$.retweeted_status.user.id_str') ) ) AND jsonb_path_exists(doc,'$.extended_entities.media ? (@.type() == "array" && @.size() <= 1)')  )  GROUP BY doc #> '{retweeted_status,in_reply_to_status_id}';
SELECT doc #> '{quoted_status,favorite_count}' as group, COUNT(*) FROM Twitter  WHERE ( ( ( jsonb_path_exists(doc,'$.user.lang.type() ? (@ == "string")') AND ( ( ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.user.friends_count ? (@ <= 2151584.114948)') AND jsonb_path_exists(doc,'$.quoted_status.user.profile_sidebar_fill_color') ) OR jsonb_path_exists(doc,'$.quoted_status.user.url ? (@ starts with "ht")') ) OR jsonb_path_exists(doc,'$.retweeted_status.user.id_str') ) ) AND jsonb_path_exists(doc,'$.extended_entities.media ? (@.type() == "array" && @.size() <= 1)')  ) AND ( jsonb_path_exists(doc,'$.in_reply_to_screen_name.type() ? (@ == "string")') OR jsonb_path_exists(doc,'$.retweeted_status.user.profile_background_tile ? (@ == false)') ) )  GROUP BY doc #> '{quoted_status,favorite_count}';
SELECT doc #> '{retweeted_status,quoted_status,favorited}' as group, COUNT(*) FROM Twitter  WHERE ( ( ( jsonb_path_exists(doc,'$.user.lang.type() ? (@ == "string")') AND ( ( ( jsonb_path_exists(doc,'$.retweeted_status.quoted_status.user.friends_count ? (@ <= 2151584.114948)') AND jsonb_path_exists(doc,'$.quoted_status.user.profile_sidebar_fill_color') ) OR jsonb_path_exists(doc,'$.quoted_status.user.url ? (@ starts with "ht")') ) OR jsonb_path_exists(doc,'$.retweeted_status.user.id_str') ) ) AND jsonb_path_exists(doc,'$.extended_entities.media ? (@.type() == "array" && @.size() <= 1)')  ) AND ( ( ( jsonb_path_exists(doc,'$.extended_tweet.extended_entities.media') OR jsonb_path_exists(doc,'$.retweeted_status.extended_tweet.entities.hashtags') ) OR jsonb_path_exists(doc,'$.retweeted_status.quoted_status.user.profile_link_color') ) OR jsonb_path_exists(doc,'$.user.profile_banner_url ? (@ starts with "ht")') ) )  GROUP BY doc #> '{retweeted_status,quoted_status,favorited}';
